import React from 'react';
import { Link } from 'react-router-dom';

const EasyGame = () => {
  return (
    <div>
      <h1>Easy Game!</h1>
      <br />
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/rule">Rule</Link>
        </li>
      </ul>
    </div>
  );
};

export default EasyGame;
